"""
130. 被围绕的区域
给定一个二维的矩阵，包含 'X' 和 'O'（字母 O）。

找到所有被 'X' 围绕的区域，并将这些区域里所有的 'O' 用 'X' 填充。

示例:

X X X X
X O O X
X X O X
X O X X
运行你的函数后，矩阵变为：

X X X X
X X X X
X X X X
X O X X
解释:

被围绕的区间不会存在于边界上，换句话说，任何边界上的 'O' 都不会被填充为 'X'。 任何不在边界上，或不与边界上的 'O' 相连的 'O' 最终都会被填充为 'X'。如果两个元素在水平或垂直方向相邻，则称它们是“相连”的。

通过次数41,992提交次数104,043
"""


# 遍历方法：沿着外围遍历一圈，记录下所有o，并从这些o开始向内部遍历，遇到o记录下坐标。
# 如果一开始没有遇到o，就全部返回成x
import itertools
from pprint import pprint
from collections import deque
from tqdm import tqdm


class Solution:
    def solve(self, board):
        self.directions = [(0, 1), (0, -1), (-1,0), (1, 0)]
        """
        Do not return anything, modify board in-place instead.
        """
        self.row_length = len(board)
        if self.row_length == 0:
            return
        
        self.column_length = len(board[0])
        if self.column_length == 0:
            return

        for i in tqdm(range(self.row_length)):
            if board[i][0] == 'O':
                self.bfs(board, (i, 0))
                
            if board[i][self.column_length-1] == 'O':
                self.bfs(board, (i, self.column_length-1))
                
        for j in tqdm(range(1, self.column_length-1)):
            if board[0][j] == 'O':
                self.bfs(board, (0, j))
                
            if board[self.row_length-1][j] == 'O':
                self.bfs(board, (self.row_length-1, j))
        
        for i in tqdm(range(self.row_length)):
            for j in range(self.column_length):
                if board[i][j] == "#":
                    board[i][j] = 'O'
                else:
                    board[i][j] = "X"
                    

        return
        
        
        
    def bfs(self, board, letter_o):
        board[letter_o[0]][letter_o[1]] = "#"
        queue = deque()
        queue.append(letter_o)
        while queue:
            latter_o = queue.popleft()
            for direction in self.directions:
                next_row_index = letter_o[0] + direction[0]
                next_column_index = letter_o[1] + direction[1]
                
                if (next_row_index >= 0
                and next_row_index < self.row_length
                and next_column_index >= 0
                and next_column_index < self.column_length):
                    if board[next_row_index][next_column_index] == 'O':
                        queue.append((next_row_index, next_column_index))
                        board[next_row_index][next_column_index] = "#"

        return
            

